import {useState} from 'react'

const Tasks = () => {
    const [tasks,settasks] = useState([
        {
            id:1,
            text:'Doctors Appointment',
            day: 'FEB 5th at 2:30 pm',
            reminder: true,
    
        },
        {
            id:2,
            text:'Meeting at School',
            day: 'FEB 5th at 2:30 pm',
            reminder: true,
    
        },
        {
            id:3,
            text:'Food Shopping',
            day: 'FEB 5th at 2:30 pm',
            reminder: false,
    
        }
    ])
    return (
        <>
          {tasks.map((task) => (<h3 key={task.id}>{task.text}</h3>)
          )}
        </>
    )
} 

export default Tasks
